import mathclass KNeighborsClassifier:  def __init__(self, n_neighbors):    self.n_neighbors = n_neighbors    self.closestNeigbors = []      def fit(self, X, y):    self.X = X    self.y = y    #get number of different classifcations    classes = set()    for x in y:      classes.add(x)    print(classes)  def predict(self, Xtest):    numOfColumns = self.X.shape[1]    numOfRows = self.X.shape[0]    for row in range(numOfRows):      xtest1 = Xtest[0]      xtest2 = Xtest[1]      x1 = self.X[row,0]      x2 = self.X[row,1]      euclidDist = math.sqrt((x1 - xtest1) **2 + (x2 -xtest2) **2)      print(euclidDist)